    public function getSourceContext()
    {
        return new Source("{% extends 'base.html.twig' %}

{% block title %}Se connecter à son compte {% endblock %}

{% block navbar %}
    {% include 'include/_navbar_secondary.html.twig' %}
{% endblock %}

{% block body %}
    <section class=\"container mt-5\">
        <div class=\"div-form\">
            <form method=\"post\" class=\"form-login p-1 p-lg-5 mb-5 mb-lg-0\">
                {% if error %}
                    <div class=\"alert alert-danger\">{{ error.messageKey|trans(error.messageData, 'security') }}</div>
                {% endif %}

                <div class=\"div-title d-flex justify-content-center\">
                    <img class=\"img-tractor-left\" src=\"{{ asset('build/images/tractor.svg') }}\" alt=\"\">
                    <h2 class=\"form-title my-4 text-center\">Veuillez vous connecter</h2>
                    <img class=\"img-tractor-right\" src=\"{{ asset('build/images/tractor2.svg') }}\" alt=\"\">
                </div>
                <label for=\"inputEmail\" class=\"mt-3\">Adresse email</label>
                <input type=\"email\" value=\"{{ last_username }}\" name=\"email\" id=\"inputEmail\" class=\"form-control\" required autofocus>
                <label for=\"inputPassword\" class=\"mt-3\">Mot de passe</label>
                <input type=\"password\" name=\"password\" id=\"inputPassword\" class=\"form-control mb-3\" required>

                <input type=\"hidden\" name=\"_csrf_token\"
                       value=\"{{ csrf_token('authenticate') }}\">

                {#            Uncomment this section and add a remember_me option below your firewall to activate remember me functionality.#}
                {#            See https://symfony.com/doc/current/security/remember_me.html#}

                {#            <div class=\"checkbox mb-3\">#}
                {#                <label>#}
                {#                    <input type=\"checkbox\" name=\"_remember_me\"> Remember me#}
                {#                </label>#}
                {#            </div>#}

                <div class=\"text-center\">
                    <button class=\"btn btn-success w-100\" type=\"submit\">
                        S'enregistrer
                    </button>
                </div>
            </form>
        </div>
    </section>
    <div class=\"container-fluid mt-5\">
        <a href=\"{{ path('map') }}\" class=\"btn btn-danger\">Retour à la carte</a>
    </div>
{% endblock %}
", "security/login.html.twig", "/home/maeva/hackaton2_comparateuragricole/templates/security/login.html.twig");
